import styled, { keyframes } from 'styled-components';
import Bull from '../../BullOnCliff.PNG';
import Phone from '../../AppPhone.PNG';
import React, { useState, useEffect } from "react";

// Keyframes for fade-in effect
const fadeIn = keyframes`
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
`;

// Keyframes for shooting star effect
const shootingStar = keyframes`
 0% {
   opacity: 0;
   transform: translateX(-50px) translateY(-50px) rotate(45deg);
 }
 50% {
   opacity: 1;
   transform: translateX(150px) translateY(150px) rotate(45deg);
 }
 100% {
   opacity: 0;
   transform: translateX(300px) translateY(300px) rotate(45deg);
 }
`;

// Styled-components with fade-in effect applied to HomeWrapper1
const HomeWrapper1 = styled.div`
  background: hsla(214, 44%, 17%, 1);
  background: linear-gradient(0deg, hsla(214, 44%, 17%, 1) 0%, hsla(216, 39%, 16%, 1) 0%, hsla(214, 40%, 22%, 1) 100%);
  background-size: cover;
  width: 100%;
  height: 200vh;
  position: absolute;
  top: 0;
  animation: ${fadeIn} 2s ease-in-out; /* Apply fade-in animation */

  @media (max-width: 768px) {
    height: 250vh;
  }
`;

const Bullimg = styled.img`
  width: 42%;
  height: auto;
  position: absolute;
  right: 62%;
  top: 16%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 63.5%;
    top: 16%;
  }

  @media (max-width: 768px) {
    width: 60%;
    right: 45.5%;
    top: 10%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 35%;
  }
`;

const Phoneimg = styled.img`
  width: 40%;
  height: auto;
  position: absolute;
  right: 5%;
  top: 45%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 10%;
    top: 50%;
  }

  @media (max-width: 768px) {
    width: 50%;
    right: -5%;
    top: 40%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 55%;
  }
`;

const ShootingStar = styled.div`
  width: 2px;
  height: 2px;
  background: white;
  box-shadow: 0 0 8px white, 0 0 10px white, 0 0 15px white, 0 0 25px white;
  position: absolute;
  top: 10%;
  left: 10%;
  animation: ${shootingStar} 2s infinite ease-in-out;
  transform-origin: left top;
`;

// Other styled-components ...

export const Home = () => {
  const [showDisclaimer, setShowDisclaimer] = useState(!sessionStorage.getItem("disclaimerShown"));

  useEffect(() => {
    // Automatically scroll to top on component mount
    window.scrollTo(0, 0);
  }, []);

  const closeDisclaimer = () => {
    setShowDisclaimer(false);
    sessionStorage.setItem("disclaimerShown", "true");
  };

  const Disclaimer = ({ onClose }) => {
    return (
      <DisclaimerWrapper show={true}>
        <DisclaimerBox>
          <CloseButton onClick={onClose}>×</CloseButton>
          <DisclaimerTitle>DISCLAIMER</DisclaimerTitle>
          <DisclaimerText>
            Stock of The Day (SOTD) is a tool intended to assist you in identifying potential stocks to trade. However, it should not be the sole basis for your investment decisions. It's important to conduct your own research and consult with a financial advisor before making any trades. Please note that the regular SOTD only covers US stocks and all information is based on Eastern Standard Time (EST).
          </DisclaimerText>
          <AgreeButton onClick={onClose}>I AGREE</AgreeButton>
        </DisclaimerBox>
      </DisclaimerWrapper>
    );
  };

  return (
    <div>
      {showDisclaimer && <Disclaimer onClose={closeDisclaimer} />}
      <HomeWrapper1>
        <ShootingStar />
        <HomeText1>
          <div> Get the best, Earn the most </div>
        </HomeText1>
        <HomeText2>
          <div> Utilizing AI to generate </div>
          <div> top-tier stocks daily </div>
        </HomeText2>
        <HomeText3>
          <a href="/sotd" style={{ color: "black" }}>Today's watchlist</a>
        </HomeText3>
        <HomeText4>
          <div> We are </div>
          <div>Coming soon… </div>
        </HomeText4>
        <HomeText5>
          <div> SOTD app </div>
        </HomeText5>
        <Bullimg src={Bull} />
        <Phoneimg src={Phone} />
      </HomeWrapper1>
    </div>
  );
};
